<p>首先将每个结点的数据分为 <code>comm_sz</code> 个数据块, 每个数据块大小为 <code>count = n / comm_sz</code> 个 <code>float</code>.</p>
<p>第一阶段共 <code>comm_sz - 1</code> 步. 在第 <code>k</code> 步, 第 <code>my_rank</code> 个进程会将自己的第 <code>(my_rank - k) % comm_sz</code> 对应数据块发送给第 <code>succ = my_rank + 1</code> 个进程并累加. 注意到对于 <code>my_rank</code> 进程, 第 <code>k</code> 步的 <code>Send</code> 与 <code>Recv</code> 使用的数据块不同, 但第 <code>k + 1</code> 步的 <code>Send</code> 依赖于第 <code>k</code> 步的 <code>Recv</code> 得到的数据块. 因此 <code>Send</code> 可以是非阻塞的, 但 <code>Recv</code> 必须是阻塞的, 以确保在第 <code>k + 1</code> 步 <code>Send</code> 前, 第 <code>k</code> 步 <code>Recv</code> 已完成.</p>`,r:{minutes:1.48,words:445},y:"a",t:"exp2: MPI Allreduce"},["/course-work/hpc/2022/03/21/exp2-mpi-allreduce/index.html","/course-work/hpc/2022-03-21-exp2-mpi-allreduce.html","/course-work/hpc/2022-03-21-exp2-mpi-allreduce.md"]],["v-287531ce","/course-work/hpc/2022/03/28/exp3-%E6%B5%8B%E9%87%8F-openmp-%E5%B9%B6%E8%A1%8C-for-%E5%BE%AA%E7%8E%AF%E4%B8%8D%E5%90%8C%E8%B0%83%E5%BA%A6%E7%AD%96%E7%95%A5%E7%9A%84%E6%80%A7%E8%83%BD/",{d:"2022-03-28T00:00:00.000Z",l:"March 28, 2022",c:["Course Work"],g:["Introduction to High Performance Computing","OMP"],o:!0,e:`<table>
